import React from 'react';
import { Paper } from '@material-ui/core';

export default class Home extends React.Component  {
    render () {
        return (
            <div className="content" >
                <Paper elevation={3}className="home">
                        <h1>A Header</h1>
                </Paper>
            </div>
        )
    }
}
